import React from 'react';
import { AppBar, Toolbar, IconButton } from '@material-ui/core'

const nav_links = [
    { title: `login`, path: `/login` },
    { title: `signup`, path: `/signup` },
]

const Header = () => {
    return (
        <AppBar position='static'>
           <Toolbar>
                <IconButton>
                </IconButton>
           </Toolbar>
        </AppBar>
    )
}

export default Header;
